import React from 'react';
import './navbar.css'
import {links} from './navbarlinks'

function Sidebar() {
  return <div className='Sidebar'>
    <div id='links'>
    {links.map((link) => {
      return (
        <a href={link.url} key={link.id}>{link.text}</a>
      )
    })}
    </div>
  </div>
}

export default Sidebar;
